import React from "react";
import { useState, useEffect } from "react";

const Fetch = () => {
  const [students, setStudents] = useState([]);
  useEffect(() => {
    fetch("https://jsonplaceholder.typicode.com/users/1", {
      // method: "Post",
    })
      .then((res) => res.json())
      .then((res) => {
        setStudents([res]);
        console.log([res]);
      });
  }, []);
  const getInfo = (id)=>{
    console.log(id);
  }
  return (
    <div>
      <h1>Students List</h1>
      <div>
        {students.map((value) => (
          <h1 key={value.id}>
            Name : {value.id} - {value.name} <button onClick={getInfo()}>Get Info</button>
          </h1>
        ))}
      </div>
    </div>
  );
};

export default Fetch;
